import React from 'react';

const Announcements = () => {
  return (
    <section>
      <h2>Announcements</h2>
      <ul>
        <li>Welcome to Technology Class</li>
        <li>I look forward to working with you all!</li>
      </ul>
    </section>
  );
};

export default Announcements;
